import React from "react";
import "./jasa-card.css";

const jasaCard = ({ item }) => {
  const { imgUrl, title, desc } = item;

  return (
    <div className="jasa__item">
      <div className="jasa__img">
        <img src={imgUrl} alt="" />
      </div>
      <h5>{title}</h5>
      <p>{desc}</p>
    </div>
  );
};

export default jasaCard;
